          "Low carb bliss balls, with homemade roasted almond butter and optional medicinal shrooms. A fav snack at our house, as they're loaded with good fats and taste üëå. You can find basically all these ingredients at @thesourcebulkfoods , and make these waste free. It's not a cheap recipe to make but SO much cheaper than buying prepare ones (healthier, too). .\n Full recipe is in my bio, but here's the rough one:\n- 1 cup  almond butter\n- 1 cup coconut butter\n- 1/3 cup pure maple syrup\n- 1/3 tsp salt\n- 1/3 cup cacao powder\n- 1 tsp vanilla\n- 2 cups activated almond meal\n- 1 Tbsp powder medicinal mushrooms of choice.\n.\n1. In a large bowl, whisk together nut butter, coconut butter and maple. Add remaining ingredients and combine well. It's best to use your hands.\n2. Using clean hands, roll into approx 20 balls. \n3. Store in an airtight container x",
