        caption:
          'Lemons slice. 7 ingredients. Grain free option. CERTIFIED CROWD PLEASER. Seriously, everyone loves this slice, and it‚Äôs easy peasy to whip up. .\nDon‚Äôt exchange the coconut butter/coconut manna in the recipe, it‚Äôs needed for the texture and taste. Have you tried coconut butter before? It‚Äôs made by pulverising coconut (much the same as nut butter), and it amazing when making raw snacks, bliss balls, icing or to add fat to your morning latte. One of my fav ingredients in the pantry! You can make it yourself (by blending shredded coconut in a food processor for 10 mins), but I‚Äôve never made it as good as store bought (if you have- tips please). Anyway- enjoy!\n.\nYou‚Äôll need:\n.\n1 cup almond flour \n1/2 cup rolled oats or buckwheat grouts (for grain free). 1 1/4 cups shredded coconut\nPinch salt\n1/3 cup coconut Condensed milk\n1/3 cup (approx 3 large) juicy dates\nZest from 1 organic lemon\n.\nIcing\n.\n1/4 cup coconut oil\n1/4 cup coconut butter\n2 Tbsp condensed Condensed milk\n2 Tbsp lemon juice\nOptional- 6 drops pure lemon essential oil .\nMethod.\n1. Add almond flour, oats, coconut and salt to a food processor and pulse to combine. You want the result to be semi-fine, but can still be slightly chunky.\n2. Add remaining base ingredients and pulse to combine. The dough should be moist enough to easily hold together. Press into the base of a lined tin (mine was 15cm square). 3. Next, make your icing. Add coconut oil and condensed milk to a het proof bowl, and place over a pot of just simmering water. Melt gently, then remove bowl from heat. Add coconut butter, and whisk until uniform, then add lemon juice + optional oil, and stir to combine. Pour over base, sprinkle with extra coconut and set in fridge until the icing is firm.\n.\nüí•‚ù§Ô∏è‚ù§Ô∏èüí•',
