        caption:
          'You‚Äôll need only 5 ingredients to make this Chocolate ganache chestnut cream tart with an easy Oreo crust. This is a decadent (but simple) tart that I made for @bonnemaman_au Mother‚Äôs Day campaign. It comes together so quickly, and it‚Äôs the perfect dessert for a special occasion. The chestnut cream is vegan (of course!), and delicious! It was the first time I‚Äôd used chestnut cream, and it won‚Äôt be the last üòã #bonnemaman_au #bonnemamanpartner \nPreparation time:30 mins\nSetting time:1 hour\nServes:10-12\n23cm tart tin\n\nBase ingredients \n28 Oreo/chocolate cookies\n7 Tbsp (100g) vegan butter\n\nChocolate, chestnut ganache ingredients \n300g semi-dark chocolate, finely chopped\n3/4 cup (190ml) vegan whipping cream\n3/4 cup (230g) chestnut cream\n\nTo serve; fresh berries. \nMethod\n\n1. BASE. Add cookies to a food processor and blend until fine. Melt butter and mix through. Press into base and side of your tart tin. Set in the freezer while you prepare the filling. \n2. GANACHE. Finely chop chocolate and place in a heat proof bowl. Set aside. Add cream and chestnut cream to a small saucepan and, while continuously stirring, bring almost to the boil (bubbles should be beginning to form). Immediately pour over chocolate and stand for 3 minutes then whisk together to form a silky ganache. Remove base from freezer, then pour in ganache and smooth over. Allow to set for 1+ hours (on the bench top), then top with fresh fruit to serve.',
