          'DIY almond butter. The recipes is both activated and roasted, uses only 2 ingredients and makes the perfect, runny and smooth almond butter. The full recipe is linked in my bio, so if you wanna know how/why to activate, it‚Äôs there. I love this recipe, cos it combines the nutritional benefits of activated nuts with the superior flavour of roasted almonds. It‚Äôs more work, yes- but it‚Äôs worth it. .\nTo find the recipe you can also google ‚Äòpanaceas creamy roast almond butter‚Äô. .\nMy basic almond butter recipe looks like this:\n- 3 cups almonds\n-1/2 tsp salt\nOptional ingredients for varied flavours might include maple syrup, vanilla extract or cinnamon üëåüèΩ\n.\nPreheat to 180C. Roast almonds for 10 mins, then cool for 5 mins.\nTransfer to a high speed food processor (I tagged the brand I use) and blend for 10 minutes, till smooth, creamy and runny.',
