        caption:
          'Fluffy raspberry + cashew mousse üëå. I made this on stories a few weeks ago, and so many of you asked for the recipe. It‚Äôs pretty simple, but makes a great, high-fat, wholefoods breakfast base. Boiling the cashews is optional, but helps to get that silky smooth texture. Top with whatever ya fancy! Xx\n.\n1 cup raw cashews\n1/2 cup coconut yoghurt \n1/2 cup raspberries \n2 Tbsp maple syrup\n2 tsp lemon juice\n.\n1. Add cashews to a small pot of water and bring to a boil, cooking a further 2 mins. Leave cashews to soak 4+ hours or overnight.\n2. Drain cashews and add to a high speed blender with yoghurt, berries maple and lemon juice. Blend until very smooth, then add yo a jar and set in fridge until completely cold.\n3. Serve topped with  whatever you like. We choose berry compote, yoghurt, nut butter and our crunchy #guthealthy muesli.',
