          "Crispy sage and cashew-pumpkin pasta. Posting a lotta pasta recipes. Not sorry about it. Whole foods + 10 mins prepping time + a while family pleaser = happy days. \nYou'll need;\nüçù \n3cm wedge of a pumpkin, skin on\n1/2 brown onion\n2 cloves garlic\n1/2 cup cashews, soaked in hot water for 30 mins\n1/4 cup nutritional yeast\n1/2 cup vegan stock\nSmall handful fresh sage leave\nGood few punches of nutmeg\n1/2 Tbsp cornstarch\nSalt and black pepper, to taste\n\nMethod\n\n1. Preheat oven to 180 degrees C. \n2. Roughly cut up pumpkin into cubes, and wedge the onion. Place both, and the peeled garlic cloves, on a baking tray (with olive oil, or on a non stick mat) and bake for 20-25 mins, or until soft and delicious.\n\n3. Meanwhile, pantry sage leaves in olive oil until crisp, then set aside. \n4. Add cooked vegetables and sage to a bowl. Drain cashews, and add to the bowl, along with remaining ingredients. Use a stick blender to combine, until almost smooth. \n4. Cook your pasta as per packet instructions. While it‚Äôs on the boil, add sauce to a saucepan and heat over a medium flame, whisking through out. This will allow the sauce to thicken (and whisking will stop any clumps forming). Serve while hot with saut√©ed greens and extra sage, or whatever you fancy!‚ù§Ô∏è",
