          'Caramelised  Buerre Bosc pear and chocolate brownie üí•üç©üòã! Chocolate and pear is a combo you never knew you lived- and this brownie here is gonna teach you that.‚†Ä\n‚†Ä\nWet Ingredients ‚†Ä\n‚†Ä\n2 chia eggs (2 Tbsp chia seeds (preferably ground, but can use them whole)+ 120mL water, mixed and set aside until thickened)\n1/4 cup vegan butter (I like miyokos or raw c) ‚†Ä\n3/4 cup coconut sugar‚†Ä\n1/2 cup almond milk\n‚†Ä\nDry ingredients ‚†Ä\n‚†Ä\n1 cup white spelt flour (or plain flour)\n1 tsp baking powder‚†Ä\n1/2 cup cacao powder‚†Ä\n1 tsp pure vanilla extract‚†Ä\n1/4 tsp good-quality salt \n1/2 tsp ground cinnamon‚†Ä\n1/2 cup diced buerre Bosc pear‚†Ä\n‚†Ä\nTopping ingredients ‚†Ä\n‚†Ä\n1 beurre Bosc pear, sliced length ways\n1 Tbsp vegan butter‚†Ä\n1 Tbsp coconut sugar ‚†Ä\n‚†Ä\nMethod‚†Ä\n‚†Ä\n1. Preheat oven to 180 degrees C‚†Ä\n2. Add the 1 Tbsp vegan butter and 1 Tbsp coconut sugar to a fry pan and brown over a low heat (be careful not to burn- cook until just fragrant). Pour into the base of a 15cm square cake tin. Layer pear as desired, and set aside. ‚†Ä\n3. Add all the wet ingredients to a saucepan, and melt over a low heat, whisking throughout. Once melted, remove from heat and set aside.‚†Ä\n4. Sift dry ingredients (except pear) into a large mixing bowl. Combine, then add the cooled wet ingredients. Mix to combine, add chopped pear and stir through. Pour batter over pear base and smooth with a wet spoon.‚†Ä\n5. Bake for 18-23 mins, or until an inserted skewer is removed with only a few crumbs intact. ‚†Ä\nThis brownie can be served warm with vegan ice cream, or enjoyed over the next few days as a moorish slice!',
