  // 					'Monday night dinner: cheesy macaroni with ketchup (made with @hotforfood nacho cheese sauce), baked tofu triangles (with molasses added to the sauce üëåüèª base recipe is on @shiramcd‚Äôs site) with peanut butter dipping sauce, roasted red cabbage with tahini drizzle üòõ GIMB = get in mah bellayyyy. For the cabbage, cut wedges, drizzle oil of choice on a sheet pan and rub both sides of cabbage into the oil, then sprinkle generously with garlic powder, onion powder and salt. Roast at 400F until brown and crispy (30-45 min). Drizzle with tahini sauce (tahini, water, lemon juice, salt). SO FREAKING GOOD. Question: have you ever craved PLAIN chicken or completely plain beef? I think for the most part, delicious food is all about the (plant-based) sauce ‚Äî ketchup, tahini, peanut butter sauce. I‚Äôd say these are the elements that make any dish crave worthy. So why not choose a base that doesn‚Äôt involve taking a life? Promise there is nothing to lose, everything to gain ü§ç #veganfortheanimals',
