  // 					'Butterfinger chocolate bars are happening in stories today ‚Äî so crunchy and sweet ‚Äòn salty!!! Also vegan, GF, refined sugar-free and oil-free. Winner. Was this anyone‚Äôs fav back in the day? The recipe (on @flora_and_vino‚Äôs site) calls for just six ingredients that you might have in your pantry right now (any sugar works in place of coconut sugar BTW). I bet a lot of cereals would be a great stand in for corn flakes if you don‚Äôt have (try anything crunchy and let me know how it goes). For the coating, I made a simple ‚Äúchocolate‚Äù using equal parts ‚Äî 3/4 c ‚Äî melted coconut oil and cocoa/cacao powder plus maple syrup (to taste). Or just melt chocolate chips. Definitely sprinkle with salt. Don‚Äôt do as I did and let your bars stick to the cooling rack! (...used to allow excess liquid chocolate to drip down.) Either grease your rack with oil or set the bars on parchment to firm up, then cut off the excess ‚Äòpooled‚Äô chocolate with a knife (thanks to you guys for the tips!!!). Tag me if you try these üòõüç´ #vegan',
