  // 					'Let‚Äôs set the record straight about kids and plant-based eating üçå I find it kinda funny that growing up, I was always told by parents that eating my veggies would make me healthy. Now, as a vegan parent, I‚Äôm sometimes questioned about whether feeding my kids a plant-based diet is safe. The answer is a resounding *yes*, but don‚Äôt take my word for it. @dr.matthewnagra answers this question with info from the largest group of nutrition experts in the world: üçå\n‚ÄúTo me it‚Äôs really disheartening to hear of parents being criticized by their peers for choosing to raise their children on a plant-based diet; however, I do understand why it happens. Misinformation is consistently spread across social media and by mainstream media outlets, so I hope to help set the record straight.\nüçå\nThe American Academy of Pediatrics and the Academy of Nutrition and Dietetics (A.N.D.), the largest group of nutrition experts in the world, agree that a well-planned vegan diet is suitable for infants and children. The A.N.D. goes further by stating these diets may provide additional health benefits for the prevention and treatment of disease, so let‚Äôs see why that is.\nüçå\nKids on plant-based diets tend to consume more fibre, vitamins, and most minerals due to the increase in fruit and vegetable consumption, while also getting adequate protein and calories. They do seem to get less total fat, saturated fat, and cholesterol, and that may be a very good thing! You might be surprised to learn that children can have fatty streaks in their arteries (early signs of heart disease) before age 1, and nearly ALL children may have fatty streaks by age 10! This is just more reason to adopt a plant-based diet at an early age as it can help prevent heart disease in the first place.\nüçå\nEating more plants may also decrease the risk of asthma and improve constipation, which is a common issue in young children. The increase in fibre and removal of dairy is often enough to relieve constipation altogether. You may have also read headlines stating that plant-based kids don‚Äôt grow as much as their meat-eating peers, but that‚Äôs not actually true. Plant-based kids seem to experience... cont‚Äôd in comments.',
