  // 					'Salted butterfinger cake with peanut butter caramel and chocolate drips, chocolate and vanilla alternating sponge (chopped butterfinger bars between layers) and chocolate and vanilla icing with butterfinger bar chunks in each dollop ‚Äî animal free üëåüèª Here‚Äôs my chocolate icing recipe: 1 c vegan butter (used Earth Balance at room temp), 3 c icing sugar, 1/2 c cocoa powder, 1 tbsp vanilla, 4 tbsp soy milk (at room temp), 1/2 tsp salt. The vanilla recipe is the same, minus the cocoa. The butterfinger bar recipe is on @flora_and_vino site. Vanilla cake recipe is on my site within the cookie dough cake post (minus the chocolate chips). I tried an alteration on a chocolate cake recipe that I didn‚Äôt love so not going to share...but in the past loved the chocolate cake recipe in the first @ohsheglows cookbook. Shared my chocolate ganache drip recipe in saved story highlights (so easy - just equals gram weights of chocolate and plant milk ‚Äî melt together in microwave). I‚Äôll try to put all this info together in a blog post if you like? Also still need a good foolproof vegan caramel recipe that doesn‚Äôt require a candy thermometer üòÖ or maybe I should just buy the damn thing. Happy birthday, @ilovechickpea Itamar!! (Thanks for the delicious exchange this morning, @jordanashani!) #vegan',
