  // 					'Salt and vinegar potatoes, coconut curried saut√©ed greens and baked ketchup molasses tofu for dinner tonight ‚Äî plants taste soooo good!!! The potatoes were a test and they turner out sooooo delicious and vinegary...although they could‚Äôve used a sauce (to add moisture to the bites). Ideas? To make them you just parboil they wedges in pure white vinegar for 4-5 min, then let rest in that same vinegar for around 4 hours ‚Äî then drain and fry in a pan with oil. Finish with s&p. Also these coco curried greens from @minimalistbaker are they BEST ‚Äî I‚Äôm 100% addicted. The tofu sauce recipe is from @shiramcd‚Äôs baked tofu triangles post except I did cubes and did half ketchup half molasses (mainly to use up the old molasses that‚Äôs been sitting in my pantry for two years). See the potato and greens cooking steps in stories üëÜüèª Who else is a die hard salt & vinegar fan and who‚Äôs going to try this?! üòò #vegan',
