  // 					'Chickpea pasta with kale pesto and saut√©ed grape tomatoes, garlic yam fries and avocado ‚Äî a plant-based, soy and nut-free dinner tonight. Can‚Äôt get enough of this healthier pesto!! More details a couple posts back. See all the steps in stories tonight but here are the recipe details: for the yam fries, chop yams and preheat oven to 400F. Drizzle with oil, garlic powder and salt and give them a toss. Bake for about 30-35 or until golden on one side (don‚Äôt flip so the face-down side can get nice and crispy). For the pesto tonight, I filled the food processor with kale (most of the stems were still on), added two tbsp oil (use whatever you have left besides unrefined coconut oil which would taste coconutty), juice of one lemon, 3/4 tsp salt, 3/4 c sunflower seeds, pepper, a few basil leaves (wish I‚Äôd had more) and about 1/4 c water to thin (the kale is so much coarser than spinach - it doesn‚Äôt break down as much so needed more moisture and I didn‚Äôt want to add more oil). For the tomatoes: saut√©ed in a little oil until blistered then added chopped garlic and cooked a little more. Added tomatoes to pasta along with pesto. The soy and nut free dinner was inspired by those of you who replied to my story question (‚Äúwhat‚Äôs stopping you from going vegan‚Äù) saying allergies are the main hurdle. Try googling ‚Äúsoy free vegan recipes‚Äù and ‚Äúnut free vegan recipes‚Äù ‚Äî there‚Äôs so much out there!!! In fact there are around 20,000 edible plant species out there. #vegan',
