  // 					'Two little vegan Easter bunnies üê∞üê∞ To say Roen was thrilled that the Easter bunny paid us a visit with is an understatement (swipe for vid from this morning üò≠üòçüòÇ ‚Äúthe Easter bunny ateded them‚Äù ‚Äî the sugar cookies (recipe from Nora Cooks Vegan blog) she‚Äôd left out for him). Her basket was filled with ‚Äúbegan‚Äù (that‚Äôs ‚Äúvegan‚Äù in toddler accent) treats and dairy-free eggs were hidden in the living room. She misses out on nothing as a vegan kid (in fact, she was revolted by the idea of dairy after I explained it was breast milk from mommy cows that some humans drink). Her Easter chocolate was from @gotniceshoes @schoccolatta @vegansupply @glowchocolatelove ‚Äî check them out next year if you need some ‚Äî so good. Hope everyone is having a great long weekend! #vegan #crueltyfreeeaster',
