  // 					'Healthier pesto *loaded* onto pasta is a new fav dinner around here. There are so many greens in the pesto (and a fraction of the oil you‚Äôd normally find), it‚Äôs like a salad and pasta in one! This bowl is from last week but made it again tonight in stories and loved it with half linguine half zucchini noodles. The loose recipe (inspired by @plantpowerpediatrician): 3 big handfuls (150g) of spinach, 1 handful basil or parsley, heaping 3/4 c nuts or seeds or a combo (did walnuts and sunflower seeds tonight), 2 tbsp oil (normally I‚Äôd use evoo but I‚Äôm out so used melted vegan butter), 1/4 nutritional yeast (if you have it ‚Äî I was out and it was still delicious!!), juice from half or whole lemon, 1 tsp salt, lots of pepper. Blend it up in a food processor and voila! You can‚Äôt mess it up. AND SO. GOOD. Tag me if you try it! #vegan #pesto',
