  // 					'Greek tofu steaks, leftover lasagna and spinach salad with tahini dress, @spreadem_kitchen smoky cheese, all the seeds, olives and avo for dins. SO GOOD. Who else is spending more time than usual obsessing over every single meal right now? üòÖüôãüèª‚Äç‚ôÄÔ∏è Food is such a major highlight of lockdown life!! For the Greek tofu steaks: I used the Greek potato marinade (recipe on the site) on scored tofu slices, marinated for four hours, baked at 425F for 15 min then pan fried each side for 3 min (see the steps and how I reduced the marinade quantities in story highlights). Loved them! Next time will try cubed on skewers souvlaki style. Hope you try this meal and prove to any vegan skeptics that there is NO compromise to eating plant-based üå± #vegan',
