  // 					"6 Ingredient Vegan Chocolate Chia Mousse. Monday chocolate...but the healthy kind. This is a go-to. It's easy + extra creamy, light and airy, very chocolatey, and just sweet enough. And?? You only need a blender + (pantry) 6 ingredients. Recipe below + linked in profile. ...\n..\nIn a bowl combine:\n3/4 cup chia seeds\n2 1/4 cups nut milk\n1/2 cup cocoa powder\n1/3 cup real maple syrup\n1 teaspoon vanilla extract\n1/2 teaspoon flakey sea salt\n\nPlace in the fridge for 2 hours or overnight. Transfer the chia mix to a blender and blend on high power until smooth and creamy. It‚Äôs helpful to scrape down the sides once or twice while blending to incorporate everything. Taste and add more maple if a sweeter mousse is desired. \nSpoon the mouse into 6 servings bowls...eat and enjoy or chill to let it thicken up even more :) PS. a high powered blender or food processor is pretty important for an extra smooth mousse.",
