  // 					'Who wants a chance to win $10,000 by making a burger? We‚Äôre back for another year of the #BlendedBurgerContest w/ the @mushroomcouncil & @bonappetitmag - let‚Äôs get into it! #ad\n\nTo enter just complete the form linked in my profile, make a blended burger, post a pic on IG, tag #BlendedBurgerContest  and you‚Äôre entered to win! In case you haven‚Äôt heard of a blended burger, it‚Äôs basically 75% ground beef and 25% chopped mushrooms + it‚Äôs an epic combo for many reasons: 1: mushrooms add moisture to make your burgers extra juicy. 2: adding mushrooms to meat makes it way more nutritious! 3: it‚Äôs better for the planet! Here\'s mine: \nFajita Mushroom Beef Burger\n\n3/4 lb ground beef\n1/4 lb crimini mushrooms, pulsed until finely chopped in a food processor\n2 teaspoons taco seasoning\n1 tsp dried parsley\n1 tsp kosher salt\n¬Ω tsp cracked black pepper\n\nFajita Veggies \n1 avocado, smashed and seasoned\n\n2 slices Pepper Jack Cheese\n2 Brioche buns, toasted\n\nTransfer the ground beef and chopped mushroom to a large bowl. Add in the taco seasonings, parsley, salt and pepper. Using your hands, incorporate everything together. Form the mixture into two 1/2"-thick patties\n\nGrill mushroom beef burgers over medium heat until medium, roughly 4-6 minutes per side. Add the cheese for the last minute to melt.\n\nServe each patty in a burger bun topped with saut√©ed fajita veggies and equal amounts of smashed avocado. .\n.\n.\n.\n.\n.\nNO PURCHASE NECESSARY. To enter and for full rules, go to www.bonappetit.com/blendedburgercontest. Starts 5/1/2020 10:00 AM ET and ends 11:59 PM ET 6/30/2020. Open to legal residents of the 50 United States/D.C. Age 18 or older, except employees of Sponsor, their immediate families and those living in the same household. Odds of winning depend on the number of entries received. Void outside the 50 United States/D.C. and where prohibited. A.R.V. of grand prize: $10,000.00. All valid entrants who post to a public Instagram account pursuant to and in full compliance with the full rules will receive a cooking apron as a bonus gift, while supplies last: ARV $10.00 ("Bonus Gift"). Limit one Bonus Gift per entrant. Sponsors: Cond√© Nast and Mushroom Council',
