  // 					'yep, you guessed it.. another banana bread recipe on your feed!üçåüçûbanana bread recipe is from @chloe.foods with a few modifications and the brown sugar icing is from @sugaredandstirred so be sure to check them out!!\nbanana bread:\nmix 1/3 cup of softened butter, 1/2 cup maple syrup, 2 eggs, 3 small (or 2 large) bananas, 1/4 cup @planetoat milk, and 1 tsp vanilla.\nthen mix in 1 tsp baking soda, cinnamon, 2 scoops @vitalproteins collagen peptides (totally optional, just omit if you don‚Äôt have any‚ò∫Ô∏è), and 1 3/4 cups flour.\nstir in some mini chocolate chips then pour into parchment paper lined loaf pan and bake at 350 degrees for about 55 minutes or until tooth pick/knife comes out clean!\n\nbrown sugar icing:\nbring 3/4 cup brown sugar, 6 tbsp @planetoat milk, and 3 tbsp of butter to a boil in a small saucepan, whisking until mixture is all combined.\nremove from heat then add in 2 cups of powdered sugar and stir.\nall icing to cool and thicken up for a few minutes then pour over your loaf and let sit for 15 minutes. I cut all of the measurements in half and there was still plenty!\n\nalso recently hit 2,000 on here and I just want you all to know I appreciate each and every one of you so much, thank you for following along!ü•∞',
