  // 					"This one feels a little scrappy but in the best possible way with some sturdier veggies/fruit you might already have on hand. Roast up some chickpeas, rice up a cauliflower, add sliced apple, some shallot and avocado and then toss it up with a super quick grainy mustard dressing. And if you don't want to deal with ricing cauliflower right now, we can say that quinoa or any other grain works in a pinch instead. It‚Äôs an unexpected and real springy-feeling power salad.‚†Ä\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\nShake up in a jar for the dressing:‚†Ä\n2 tablespoons grainy mustard‚†Ä\n2 tablespoons honey‚†Ä\n1/4 cup olive oil‚†Ä\n1/4 cup water‚†Ä\njuice and zest of one lime‚†Ä\nsalt and pepper, to taste‚†Ä\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\nPreheat your oven to 400 degrees, and place a can of chickpeas (drained, rinsed, and patted dry) on a baking sheet lined with parchment. Drizzle with olive oil and sprinkle with chili powder, salt, and pepper to taste. Roast for 20-30 minutes until crispy.‚†Ä\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\nToss together dressing, roasted chickpeas, a few cups of cauliflower rice (or grain of choice!), thinly sliced apple, thinly sliced shallot, a handful of chopped parsley and mint, and two avocados cut into chunks. Serve and eat!‚†Ä\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\n#salad #cauliflower #vegan #vegetarian #whatveganseat #plantbased #plantstrong #healthyrecipeshare #cleaneating #eatclean #realfood #eatrealfood",
