  // 					"Hi. How are you doing? Maybe you need a little boost because, wheeeew, it is all...a lot to manage right now. We‚Äôre right there with you. But if you can find yourself some oats, some carrots, a little honey or maple syrup, and some nut butter, we‚Äôve got about 30 little bite-sized pick-me-ups headed your way.‚†Ä\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\nHere's what you need:‚†Ä\n1 medium carrot, peeled and chopped‚†Ä\n1/2 cup almond butter‚†Ä\n1/2 cup pure maple syrup‚†Ä\n2 cups flaked unsweetened coconut‚†Ä\n2 cups old fashioned oats‚†Ä\n1/2 teaspoon salt‚†Ä\n1/2 teaspoon vanilla‚†Ä\n1 teaspoon cinnamon (more or less to taste)‚†Ä\nwhite chocolate chips (optional)‚†Ä\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\nAdd carrot chunks to the bowl of a food processor and pulse until finely chopped. Remove carrots and set aside. Add oats and coconut. Pulse until coarsely ground. Add all other ingredients, including the chopped carrots. Pulse until a smooth-ish, sticky ‚Äúdough‚Äù forms. Add chocolate chips and pulse until chopped.‚†Ä\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\nRoll into bites. Store in the fridge or freezer. Mwah!\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\n#snack #snacktime #snackattack #carrotcake #healthysnack #healthyrecipeshare #cleaneating #eatclean #realfood #eatrealfood #vegan #vegetarian #whatveganseat #plantbased #plantstrong",
