  // 					"If you‚Äôre not currently using your vodka as a backup disinfectant then boy do we have a delicious and incredibly easy recipe for you! We swapped out the cream for, wait for it (and trust), coconut milk to make it vegan but ALSO because you might already have a can on hand. Quick, easy and totally pantry friendly.‚†Ä\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\nHeat a few tablespoons of olive oil over low heat, and add 3 cloves of minced garlic. Once fragrant, add a 6-oz. can of tomato paste and stir until it's deep red in color. Add 1/4 cup of vodka and let it sizzle out. Add a can of coconut milk and a teaspoon of salt, stir, and let it all simmer for a bit. Add a pound of cooked pasta and stir it all together. Serve and eat!‚†Ä\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\n#vodka #pasta #noodles #noodleworship #vegan #vegetarian #whatveganseat #plantbased #plantstrong",
