  // 					'It‚Äôs ok if you‚Äôre baking more these days, and it‚Äôs ok if all those things are desserts. Like, so ok. These carrot muffins whip up in the blender and definitely fill that dessert need, but also do a fine job with that breakfast need, healthy snack need or just a general vegetable and ok-probably-better-than-all-day-cookies need. (There are also a few other options on the blog - banana, pumpkin, zucchini, apple - if you find yourself on a pantry blender muffin kick.)‚†Ä\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\nBlend this all up to make your batter:‚†Ä\n2 cups rolled oats‚†Ä\n8 medjool dates, pits removed‚†Ä\n1/2 cup olive oil‚†Ä\n1/4 cup real maple syrup‚†Ä\n3‚Äì4 carrots, peeled and shredded (about 2 cups total)‚†Ä\n2 eggs‚†Ä\n1 teaspoon baking soda‚†Ä\n1/2 teaspoon cinnamon‚†Ä\npinch of salt‚†Ä\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\nPour batter into a greased or lined muffin tin. Bake for 15-18 minutes at 350 degrees, until the tops gently spring back when you press into them. Eat all week!‚†Ä\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\n#muffins #carrotcake #glutenfree #healthyrecipeshare #cleaneating #eatclean #realfood #eatrealfood #vegetarian #veg #vegetarianfood',
