  // 					"Many of us are playing the ‚Äúis it a rice night or a noodle night?‚Äù game right now so for this one, we really hope it‚Äôs a noodle night in your house. The sauce is a cinch. What do you have for protein - tofu? chicken? tempeh? beef? - anything works! Toss any kind of chopped veggies ¬†in there and you're throwing a pretty scrumptious little noodle stir fry on the table, kid. Way to go!‚†Ä\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\nShake up in a jar for the sauce:‚†Ä\n1/4 cup soy sauce‚†Ä\n2‚Äì3 tablespoons brown sugar or honey‚†Ä\n1/4 cup water‚†Ä\n2‚Äì3 tablespoons white vinegar, to taste‚†Ä\n1 teaspoon chili paste, to taste‚†Ä\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\nIf using tofu (as pictured), press and cut a package of tofu into cubes. In a nonstick skillet over medium high heat, fry tofu with a little olive oil until golden brown. Add a little sauce to get a nice browned crust and set aside in a bowl.‚†Ä\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\nHeat a little more oil in the pan and add 3-4 cups of chopped veggies and two cloves of minced garlic, and stir fry until crisp. Add 7-8 ounces of cooked noodles and half the sauce and stir fry. Add tofu and top with peanuts, cilantro, and lime. YUM.‚†Ä\n‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä‚†Ä\n#stirfry #vegetarian #veg #vegetarianfood #meatless #meatlessmonday #healthyrecipeshare #cleaneating #eatclean #realfood #eatrealfood",
